import React from "react";
import Home from "./components/Home";
import Navbar from "./components/Navbar";
import Theme from "./components/Theme";

const App = () => {
  state = { dark: true }
  callbackFunction = (isDark) => {
    this.setTheme({dark: isDark})
  }
  return (
    <>
      <Theme parentCallback={this.callbackFunction}/>
      <div className={`${this.state.dark ? bg-zinc-900 : bg-white} w-full h-screen`}>
        <Navbar />
        <Home />
      </div>
    </>
  );
};

export default App;
